import React from 'react';

const TodoListItem = (props) => {
    return(
        <div class="row">
            <div class="col s12">
                <div class="card">
                    <span class="card-title">Card Title</span>
                    <div class="card-content">{props.todos.name}</div>
            <div class="card-action">
          <a href="#">This is a link</a>
        </div>
      </div>
    </div>
  </div>
    );
}

export default TodoListItem;
